import React from 'react';
import logo from '../../logo.svg';
import '../App/App.css';

export default function Dashboard() {
  return (
    <div>
      <img src={logo} className="App-logo" alt="logo" />
      <h1>TaskIt</h1>
    </div>
  );
}
